import React from "react";

class Order extends React.Component {
  render() {
    // talluy up the order
    const orderId = Object.keys(this.props.order);
    return (
      <div className="order-wrap">
	<h2>Order!!</h2>
	<ul>
	  {orderId}
	</ul>
	
      </div>
    );
  };
};

export default Order;
